ReactDOM.render(
  <React.StrictMode>
    <ThemeProvider root>
      <ToastProvider position={'top-end'}>
        <App />
      </ToastProvider>
    </ThemeProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
